import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>DNA Analyzer</h1>
      <p>This is a website that uses NUPACK to analyze and design DNA.</p>
      <p>For more information, click <a href='https://docs.nupack.org/'>here</a></p>
    </div>
  );
}

export default App;
